import React, {useState} from 'react'

function ImageDetailView(props) {

    const [Img2View, setImg2View] = useState({
                                                src : null ,
                                                despcription: '' ,
                                            })

    return (
        <div className='imageDetalViewRoot'>
            <div className='imageDetail'>
                <img src={Img2View.src} />
            </div>
            <div className='imageThumbNails'>
                <div className='imageArray'>
                    {props.ImgArray.map(image => (
                        <div className='album' 
                            key={image.id}
                        >
                            <img src={image.src} />
                        </div>   
                    ))}
                </div>
            </div>
        </div>
    )
}

export default ImageDetailView
